  const showCartHandler = () => {
    setCartIsShown(true);
  };
  const hideCarthandler = () => {
    setCartIsShown(false);
  };
  return (
    <CartProvider>
      <Navbar />
      <Cart />
      <Availablecakes />
    </CartProvider>
  );
}

export default App;
